import axiosClient from "../api/axiosClient";

const QuizService = {
    getQuizzes : async (params) =>{
        const url = "/public/quizzes";
        return axiosClient.get(url);
    },
    getQuizByCode: async (code) =>{
        const url = `/public/quizzes/${code}`;
        return axiosClient.get(url);
    }
}
export default QuizService;
